import './index.css'

import React from 'react';

const Winner = (props) => {
    const lost = props.gameResult
    const caption = (lost ? "Sorry but you lost the game" : "You won! You should play again")
    return (
        <div>
            <div>{caption}</div>
            <button onClick={this.handleReset}>Play Again?</button>
        </div>
    )
}

export default Winner
